import React from 'react'
import aboutImg from ".//Images/about-me.jpg.jpg"
function AboutMe() {
  return (
    <section id='AboutMe' className='about-section'>
      <div><img src={aboutImg} alt="" /></div>
      div
      
    </section>
  )
}

export default AboutMe
